import React, { useState, useEffect } from "react";
import axios from 'axios'
import {
  Card,
  CardBody,
  CardTitle,
} from "reactstrap";

const Destinations = () => {
  
  const [data, setData] = useState([])
  const [update, setUpdate] = useState({})

  useEffect(()=>{
    axios
    .get('http://127.0.0.1:8000/destinationCreate/')
    .then((response)=>{
        setData(response.data)
    })
    .catch((error)=>{
        console.log(error)
    })
},[data])


const handleInputImageFile = (e)=>{
  const file = e.target.files[0];
  const formDataImage = new FormData();
  formDataImage.append('name', formdata.name);
  formDataImage.append('email', formdata.email);
  formDataImage.append('phone', formdata.phone);
  formDataImage.append('position', formdata.position);
  formDataImage.append('department', formdata.department);
  formDataImage.append('img', file);

  setFormdata(formDataImage)
}

  return (
    <>
      <Card>
        <CardTitle tag="h6" className="border-bottom p-3 mb-0">
          <i className="bi bi-globe-central-south-asia"> </i>
          Destinations
        </CardTitle>
        <CardBody className="">

        <table class="table table-striped shadow">
  <thead>
    <tr>
      <th scope="col">#</th>
      <th scope="col">Destination</th>
      <th scope="col">Destination State</th>
      <th scope="col">Destination District</th>
      <th scope="col">OPERATIONS</th>
    </tr>
  </thead>
  <tbody>

    {/* // If Not Using Pagination Use => data.map // */}
  {data.map((dest, index)=>{
        return(
            <tr key={index}>
            <th scope="row">{index + 1}</th>
            <td>{dest.place_name}</td>
            <td>{dest.state}</td>
            <td>{dest.district}</td>
            <td><img src = {dest.image}></img></td>
            <td>
            <button className='btn btn-primary'  data-bs-toggle="modal" data-bs-target="#exampleModalUpdate">Update</button> &nbsp;
            <button className='btn btn-danger'  data-bs-toggle="modal" data-bs-target="#exampleModalsDelete">Delete</button>
            </td>
          </tr>
        )
    })}
   
    </tbody>
    </table>
    </CardBody>
    </Card>

    <div class="card" style={{width: "18rem"}}>
    <img src="" class="card-img-top" alt="..."></img>
    <div class="card-body">
    <h5 class="card-title">Card title</h5>
    <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
    <a href="#" class="btn btn-primary">Go somewhere</a>
    </div>
    </div>
   

    </>
  );
};

export default Destinations;
